import * as React from 'react';
import Link from '@mui/material/Link';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';

import Title from './Title';
import axios from 'axios';

function createData(_id, description, amount,mode) {
  return { _id, description, amount,mode };
}
// Generate Order Data
var rows=[];

React.useEffect(()=>{
  up();
});


async function up(){
await axios.get('http://localhost:2000/transaction/',{withCredentials: true}).then((res)=>{
    for(var transaction of res.data){
      console.log(transaction);
      rows.push(createData(transaction._id,transaction.description,transaction.amount,transaction.mode));
      
    }
  }).catch((err)=>{console.log(err)});

};

/*
const rows = [
  createData(
    '',
    'Elvis Presley',
    'Tupelo, MS',
    'VISA ⠀•••• 3719',
    312.44,
  ),
  createData(
    1,
    '16 Mar, 2019',
    'Paul McCartney',
    'London, UK',
    'VISA ⠀•••• 2574',
    866.99,
  ),
  createData(2, '16 Mar, 2019', 'Tom Scholz', 'Boston, MA', 'MC ⠀•••• 1253', 100.81),
  createData(
    3,
    '16 Mar, 2019',
    'Michael Jackson',
    'Gary, IN',
    'AMEX ⠀•••• 2000',
    654.39,
  ),
  createData(
    4,
    '15 Mar, 2019',
    'Bruce Springsteen',
    'Long Branch, NJ',
    'VISA ⠀•••• 5919',
    212.79,
  ),
];
*/
function preventDefault(event) {
  event.preventDefault();
  up();
}

export default function Orders() {
  return (
    <React.Fragment>
      <Title>Recent Expense</Title>
      <Table size="small">
        <TableHead>
          <TableRow>
            <TableCell>TransactionID</TableCell>
            <TableCell>Description</TableCell>
            <TableCell>Credit/debit</TableCell>
            <TableCell>Amount</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row._id}>
              <TableCell>{row.description}</TableCell>
              <TableCell>{row.mode}</TableCell>
              <TableCell align="right">{`$${row.amount}`}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
      <Link color="primary" href="#" onClick={preventDefault} sx={{ mt: 3 }}>
        See more expense
      </Link>
    </React.Fragment>
  );
}
